// Component imports
import React, {useContext} from 'react';
import { HomePageContext } from '../../contexts/HomePageContext';

export default function FidaDebugger(){
    const {hpContext, setHpContext} = useContext(HomePageContext);

    return(
        <p style={{position: 'fixed', bottom: 0, left: 0, backgroundColor: '#ee9999'}}>
            <h5><b>Debugger</b></h5><br />
            <b>RoomID:</b> {hpContext.roomSelection.id}<br />
            <b>RoomName:</b> {hpContext.roomSelection.name}<br />
            <b>RoomName:</b> {hpContext.bookings.bookings !== [] ? "true" : "false"}<br />
        </p>
    );
};
